import React, { useState } from "react";

function Pagination(){
  const [currentPage, setCurrentPage] = useState(1);
  const [itemsPerPage] = useState(4);

  const items = [
    "Item 1",
    <iframe width="560" height="315" src="https://www.youtube.com/embed/FLQnHPgQ9VY" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen="allowfullscreen"></iframe>,
    "Item 2",
    <iframe width="560" height="315" src="https://www.youtube.com/embed/XZA5qKMnEHg" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen></iframe>,
    "Item 3",
    <iframe width="560" height="315" src="https://www.youtube.com/embed/kXH4ObAsUTs" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen></iframe>,
    "Item 4",
    <iframe width="560" height="315" src="https://www.youtube.com/embed/zwYdgM4ifq0" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen></iframe>,
    "Item 5",
    <iframe width="560" height="315" src="https://www.youtube.com/embed/xnUUAVqBwOw" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen></iframe>,
  ];

  const handleClick = (event, pageNumber) => {
    event.preventDefault();
    setCurrentPage(pageNumber);
  };

  const lastItemIndex = currentPage * itemsPerPage;
  const firstItemIndex = lastItemIndex - itemsPerPage;
  const currentItems = items.slice(firstItemIndex, lastItemIndex);

  const pageNumbers = [];
  for (let i = 1; i <= Math.ceil(items.length / itemsPerPage); i++) {
    pageNumbers.push(i);
  }

  return (
    <div>

      <div>
        {currentItems.map((item, index) => (
          <p key={index}>{item}</p>
        ))}
      </div>
      <div>
        {pageNumbers.map((pageNumber) => (
          <button
            key={pageNumber}
            onClick={(event) => handleClick(event, pageNumber)}
          >
            {pageNumber}
          </button>
        ))}
      </div>
    </div>
  );
        }

export default Pagination;
